import java.util.ArrayList;
import java.util.Collections;
import java.util.HashMap;
import java.util.Comparator;

public class FrequencyBasedSorting {

  public String frequencySort(String A) {
    HashMap<Character, Integer> hm = new HashMap<>();
    int N = A.length();

    for (int i = 0; i < N; i++) {
      char cur = A.charAt(i);
      if (hm.containsKey(cur)) {
        int ct = hm.get(cur) + 1;
        hm.put(cur, ct);
      } else {
        hm.put(cur, 1);
      }
    }
    System.out.println(hm);

    ArrayList<String> strArr = new ArrayList<>();
    for (HashMap.Entry<Character, Integer> iterMap : hm.entrySet()) {
      strArr.add(iterMap.getValue() + "_" + iterMap.getKey());
    }

    Collections.sort(strArr, new CustomSort());
    System.out.println(strArr);
    StringBuilder sb = new StringBuilder();
    for (int i = 0; i < strArr.size(); i++) {
      int times = Integer.parseInt(strArr.get(i).split("_")[0]);
      String alphabet = strArr.get(i).split("_")[1];

      for (int j = 0; j < times; j++) {
        sb.append(alphabet);
      }
    }

    // System.out.println(sb);

    return sb.toString();
  }

  class CustomSort implements Comparator<String> {
    @Override
    public int compare(String o1, String o2) {
      int o1times = Integer.parseInt(o1.split("_")[0]);
      String o1Alphabet = o1.split("_")[1];

      int o2times = Integer.parseInt(o2.split("_")[0]);
      String o2Alphabet = o2.split("_")[1];

      if (o1times == o2times) {
        return o1Alphabet.compareTo(o2Alphabet);
      } else if(o1times < o2times) {
        return 1;
      } else if (o1times > o2times) {
        return -1;
      }
      return 0;
    }
  }

  public static void main(String[] args) {
    FrequencyBasedSorting fb = new FrequencyBasedSorting();
    // String A = "scaleracademy";
    String A = "";
    fb.frequencySort(A);
  }
}
